-- ----------------------------
-- View structure for v_requerimientos
-- ----------------------------
DROP VIEW IF EXISTS `v_requerimientos`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `v_requerimientos` AS SELECT
	u.F_ClaCli,
	u.F_NomCli,
	p.F_IdPed,
	p.F_StsPed,
	p.F_FecEnt,
	d.F_ClaPro,
	m.F_DesPro,
	d.F_Cant
FROM
	tb_medica m,
	tb_detpedido d,
	tb_pedidos p,
	tb_uniatn u
WHERE
	u.F_ClaCli = p.F_ClaCli
AND p.F_IdPed = d.F_IdPed
AND d.F_ClaPro = m.F_ClaPro
GROUP BY
	d.F_Id ;

